import React from "react";
import { Box, MeshDistortMaterial } from "@react-three/drei";

export default function AnimatedBox() {
  return (
    <Box visible args={[2.35, 2.35, 2.35]} scale={1} rotateY={true}> 
      <MeshDistortMaterial color={"#8352FD"} attach={"material"} distort={0.6}  />
    </Box>
  )
}
